class Solution {
    func minSizeSubarray(_ nums: [Int], _ target: Int) -> Int {
        var minLen = Int.max
        var sum = 0
        var start = 0

        for (end, num) in nums.enumerated() {
            sum += num
            while sum >= target {
                minLen = min(minLen, end - start + 1)
                sum -= nums[start]
                start += 1
            }
        }

        if minLen == Int.max {
            for num in nums {
                if num == target {
                    return 1
                }
            }
            return -1
        }

        var totalSum = nums.reduce(0, +)
        if totalSum < target {
            return -1
        }

        start = 0
        sum = 0
        var index = 0
        while index < nums.count * 2 {
            sum += nums[index % nums.count]
            while sum >= target {
                minLen = min(minLen, index - start + 1)
                sum -= nums[start % nums.count]
                start += 1
            }
            index += 1
        }

        return minLen
    }
}
